import React, { useState } from "react";
import "./AddJob.css"; // Import your CSS file

const AddJob = () => {
  const [desc, setDesc] = useState("");
  const [exp, setExp] = useState("");
  const [profile, setProfile] = useState("");
  const [techs, setTechs] = useState("");
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [age, setAge] = useState("");
  const [education, setEducation] = useState("");
  const [languages, setLanguages] = useState("");
  const [internships, setInternships] = useState("");
  const [shortlist, setShortlist] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    const newJob = {
      desc: desc,
      exp: parseInt(exp),
      profile: profile,
      techs: techs.split(",").map((tech) => tech.trim()),
      firstName: firstName,
      lastName: lastName,
      email: email,
      age: parseInt(age),
      education: education,
      languages: languages.split(",").map((lang) => lang.trim()),
      internships: internships.split(",").map((intern) => intern.trim()),
      shortlist: shortlist,
    };
    console.log(newJob);

    fetch(`${process.env.REACT_APP_URL}/post`, {
      method: "POST", // or 'PUT'
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(newJob),
    })
      .then((v) => v.json())
      .then((v) => console.log("Success:", v));

    // Clear input fields after submission
    setDesc("");
    setExp("");
    setProfile("");
    setTechs("");
    setFirstName("");
    setLastName("");
    setEmail("");
    setAge("");
    setEducation("");
    setLanguages("");
    setInternships("");
    setShortlist(false);
  };

  return (
    <>
      <p className="heading" style={{ marginBottom: "0px", fontSize: "45px" }}>
        Fill in the application
      </p>
      <div className="job-form">
        <form onSubmit={handleSubmit}>
          <div>
          <input
            type="text"
            placeholder="First Name"
            value={firstName}
            onChange={(e) => setFirstName(e.target.value)}
            required
          />
          <input
            type="text"
            placeholder="Last Name"
            value={lastName}
            onChange={(e) => setLastName(e.target.value)}
            required
          />
          </div>
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
          <input
            type="number"
            placeholder="Age"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            required
          />
          <input
            type="text"
            placeholder="Education"
            value={education}
            onChange={(e) => setEducation(e.target.value)}
            required
          />
          <input
            type="text"
            placeholder="Experience (years)"
            value={exp}
            onChange={(e) => setExp(e.target.value)}
            required
          />
          <input
            type="text"
            placeholder="Profile"
            value={profile}
            onChange={(e) => setProfile(e.target.value)}
            required
          />
          <input
            type="text"
            placeholder="Technologies (comma separated)"
            value={techs}
            onChange={(e) => setTechs(e.target.value)}
            required
          />
          <input
            type="text"
            placeholder="Languages Known (comma separated)"
            value={languages}
            onChange={(e) => setLanguages(e.target.value)}
            required
          />
          <input
            type="text"
            placeholder="Previous Internships (comma separated)"
            value={internships}
            onChange={(e) => setInternships(e.target.value)}
            required
          />
          <label>
            <input
              type="checkbox"
              checked={shortlist}
              onChange={(e) => setShortlist(e.target.checked)}
            />
            Shortlist Student
          </label>
          <button type="submit">Add Job Opportunity</button>
        </form>
      </div>
    </>
  );
};

export default AddJob;
